export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},lkUkrsmXnG:{data:{id:766,attributes:{imdbId:"tt0062863",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZmQ3ZTZmYjItMDgzMi00YzJlLThhMDItNzdkNDQ2YmMyOWM4XkEyXkFqcGdeQXVyNzgzODI1OTE@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"67%"}],item_lang:{data:{id:1429,attributes:{title:h,plot:"British commando, Captain Curry, is hired by President Ubi of war-torn Congo, to steal $50 million in uncut diamonds from a time-locked vault before the separatist Simba army that's fighting Ubi's forces and the UN peacekeepers overruns the remote town where the bank that holds the vault is located. Curry teams up with his friend Ruffo, Doctor Wreid, who's an alcoholic, and Henlein, a sadistic Nazi who left Germany after WWII to work as a mercenary. The mercenaries reach the town by Ubi's train after surviving an attack from the UN peacekeepers, only to find a number of terrified Westerners who were driven out from their homes by force, including torture, rape and murder, by the Simba rebels. They agree to help them leave town and befriend one of them, a pretty widow called Claire whose husband was murdered by the rebels. As their mission nears completion everything suddenly goes horribly wrong and the story culminates in an orgy of sadistic graphic violence as Henlein betrays the group and the rebels arrive to brutalize and slaughter the whites. However, Curry still plans to complete his mission no matter what.",slug:"dark-of-the-sun"}}},books:{data:[{id:4898,attributes:{title:d,description:i,thumbnail:j,authors:[b],firstBook:true,published:k,publisher:l,subtitle:a}},{id:4899,attributes:{title:d,description:i,thumbnail:j,authors:[b],firstBook:e,published:k,publisher:l,subtitle:a}},{id:4900,attributes:{title:d,description:"\"\"The Congo. Situated at the heart of sub-Saharan Africa, it is a place where men die for diamonds. For love. And for the unholy pleasure of others... Bruce Curry is the leader of a mercenary band with the dubious support of three officers. His mission: To relieve a diamond-mining town cut off by the fighting and retrieve a priceless consignment of diamonds. Along the way, he meets a beautiful Belgian woman. Shermaine is a dream come true. But the rest of Curry's journey is about to become a living nightmare. \"\"Ranged against his ill-disciplined unit are bandits, guerillas, and hostile tribes that infest the land. In a sinister atmosphere of omnipotent evil, Curry fights to stay alive--and protect Shermaine, his one true love. But to do so, he must face another, even deadlier enemy: one of his own men... \"\" \"\"",thumbnail:a,authors:[b],firstBook:e,published:"2003-01-01",publisher:a,subtitle:"The Sunbird"}},{id:4901,attributes:{title:h,description:"They hunt diamonds. They hunt cannibals. They hunt each other. They're mercenaries in the Congo, a battlefield torn apart like a vast, wide-open wound. For mercenary leader Bruce Curry, the mission means hunting the thing he hates most and savoring every shameless minute. For beyond hate, beyond revenge, is the thrill of hunting the most dangerous and cunning game of all -- man.",thumbnail:a,authors:[b],firstBook:e,published:"1998-11-01",publisher:"Yestermorrow Incorporated",subtitle:a}},{id:4902,attributes:{title:d,description:"Bruce Curry is the leader of a mercenary band with the dubious support of three white officers. His mission is to relieve a mining town cut off by the fighting and to retrieve a priceless consignment of diamonds. Ranged against his ill-disciplined unit are bandits, guerillas and hostile tribes that infest the land. But there is another, even deadlier enemy - one of his own men...",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HFTbwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"1998-01-01",publisher:"Pan",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309468245}}("","Wilbur Smith","movie","The Dark of the Sun",null,"series",1,"Dark of the Sun","A gendarme snatched up his rifle from where it lay at his feet; Bruce saw him elbow his way towards the side of the truck to begin firing; he was working the slide to lever a round into the breech. 'Mwembe!' Bruce shouted the gendarme's name, but his voice could not penetrate the uproar. In two seconds the whole situation would dissolve into a pandemonium of tracer and bazooka fire. Hired to kill. Fighting to live. Captain Bruce Curry has a simple enough mission, or so he thinks: lead his mercenary soldiers to rescue a town cut off by rebel fighting in the Belgian Congo. It soon becomes clear that the town's diamond supplies are the real focus of the mission he's been sent on. Although Curry soon finds something more valuable than diamonds, and will do anything to protect it. But there's one thing Curry hadn't counted on - that his most deadly enemies may not be the ones he's facing down the barrel of a gun, but the ones who are right beside him . . . An action-packed thriller featuring a mismatched band of mercenaries, from global bestseller Wilbur Smith","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sRNDDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2018-01-01","Bonnier Publishing Fiction Ltd."))